//==============================================================================
/** Our demo synth sound is just a basic sine wave.. */
struct SopranoSound : public juce::SynthesiserSound
{
    SopranoSound() {}

    bool appliesToNote(int /*midiNoteNumber*/) override { return true; }
    bool appliesToChannel(int /*midiChannel*/) override { return true; }
};

//==============================================================================
/** Our demo synth voice just plays a sine wave.. */
struct SopranoVoice : public juce::SynthesiserVoice
{
    SopranoVoice() 
    {
        //sampleRate = getSampleRate();
        DBG("Natural Frequency = " << getSampleRate() * step << ", Sample Rate = " << getSampleRate());
    }

    bool canPlaySound(juce::SynthesiserSound* sound) override
    {
        return dynamic_cast<SopranoSound*> (sound) != nullptr;
    }
    void startNote(int midiNoteNumber, float velocity,
        juce::SynthesiserSound*, int /*currentPitchWheelPosition*/) override
    {
        x = 0;
        level = velocity * 0.15;

        auto f = juce::MidiMessage::getMidiNoteInHertz(midiNoteNumber) / 100.0;
        DBG(f);
        step = f / getSampleRate();
        n = 1.0 / step;

        //angleDelta = cyclesPerSample * juce::MathConstants<double>::twoPi;
    }

    void stopNote(float /*velocity*/, bool allowTailOff) override
    {
        x = -1;
        clearCurrentNote();
    }



    void pitchWheelMoved(int newPitchWheelValue) override
    {
        DBG("bend->" << newPitchWheelValue);
    }
    void controllerMoved(int controllerNumber, int newValue) override {
        DBG("controller-> Number: " << controllerNumber << " Value: " << newValue);
    }

    void renderNextBlock(juce::AudioBuffer<float>& outputBuffer, int startSample, int numSamples) override
    {
        if (x != -1)
        {
            while (--numSamples >= 0)
            {
                double currentSample = level * Spline(step * double(x));
                //DBG("Current Sample=" << currentSample);

                for (auto i = outputBuffer.getNumChannels(); --i >= 0;)
                    outputBuffer.addSample(i, startSample, currentSample);

                ++startSample;
                if (++x >= n)
                {
                    x = 0;
                }
            }
        }
    }


private:
    int x = -1;
    double  level = 0.0, n = 0.0;
};


